export function ContactList({ contacts, onBtnDelete }) {
  // , onBtnDelete
  return (
    <ul className="contactList">
      {contacts.map(item => (
        <li className="contactItem">
          {item.name}: <span>{item.number}</span>
          <button key={item.id} onClick={onBtnDelete}>
            Delete
          </button>
        </li>
      ))}
    </ul>
  );
}
